import React from 'react'

function Error_404() {
    return (
      <div style={{ width: "100%" }}>
        <center>
          <div style={{width:"500px",height:"500px"}}>
              <img style={{ height:'400px',width:'400px' }} alt="404" src="/images/404.gif" />
          </div>
        </center>
      </div>
    );
}

export default Error_404
